(1, '我是谁', '### 我是一盏灯\n\n### 我想知道黑夜能否将我淹没\n\n### 我听见远处的钟声，震的我慌乱\n\n### 我看见头顶的无数支持者，星星\n\n### 我要坚持这无人的夜晚，等待黎明\n\n### 我是一株草\n\n### 我假装我内心足够强大\n\n### 我感到鲜花姐姐的冷默\n\n### 我触摸蝴蝶的翅膀，不到\n\n### 我担心有一只鞋会从我身上，走过\n\n### 我哭泣不能再见到我的眼泪，露珠\n\n### 我是一直蜗牛\n\n### 我理解猎豹的勇猛\n\n### 我说那是不属于我的炫耀\n\n### 我梦想有一双翅膀\n\n### 我尝试和雄鹰比翼\n\n### 我希望我也能有一个梦想\n\n### 我是一个平凡的卑微者\n\n\n\n\n\n\n\n', 2, '有文章', '2020-07-14 00:00:00', 140, 0, 0, 0, 0, 1597048609, 5),
(28, '三字经', '<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"http://stkit.cn/upload/imgs/8xKPOh.jpg\" alt=\"\" width=\"750\" height=\"399\" /></p>\n<p style=\"text-align: center;\">人之初，性本善。性相近，习相远。</p>\n<p style=\"text-align: center;\">苟不教，性乃迁。教之道，贵以专。</p>\n<p style=\"text-align: center;\">昔孟母，择邻处。子不学，断机杼。</p>\n<p style=\"text-align: center;\">窦燕山，有义方。教五子，名俱扬。</p>\n<p style=\"text-align: center;\">养不教，父之过。教不严，师之惰。</p>\n<p style=\"text-align: center;\">子不学，非所宜。幼不学，老何为。</p>\n<p style=\"text-align: center;\">玉不琢，不成器。人不学，不知义。</p>\n<p style=\"text-align: center;\">为人子，方少时。亲师友，习礼仪。</p>\n<p style=\"text-align: center;\">香九龄，能温席。孝于亲，所当执。</p>\n<p style=\"text-align: center;\">融四岁，能让梨。悌于长，宜先知。</p>\n<p style=\"text-align: center;\">首孝悌，次见闻。知某数，识某文。</p>\n<p style=\"text-align: center;\">一而十，十而百。百而千，千而万。</p>\n<p style=\"text-align: center;\">三才者，天地人。三光者，日月星。</p>\n<p style=\"text-align: center;\">三纲者，君臣义。父子亲，夫妇顺。</p>\n<p style=\"text-align: center;\">曰春夏，曰秋冬。此四时，运不穷。</p>\n<p style=\"text-align: center;\">曰南北，曰西东。此四方，应乎中。</p>\n<p style=\"text-align: center;\">曰水火，木金土。此五行，本乎数。</p>\n<p style=\"text-align: center;\">十干者，甲至癸。十二支，子至亥。</p>\n<p style=\"text-align: center;\">曰黄道，日所躔。曰赤道，当中权。</p>\n<p style=\"text-align: center;\">赤道下，温暖极。我中华，在东北。</p>\n<p style=\"text-align: center;\">寒燠均，霜露改。右高原，左大海。</p>\n<p style=\"text-align: center;\">曰江河，曰淮济。此四渎，水之纪。</p>\n<p style=\"text-align: center;\">曰岱华，嵩恒衡。此五岳，山之名。</p>\n<p style=\"text-align: center;\">古九州，今改制。称行省，三十五。</p>\n<p style=\"text-align: center;\">曰士农，曰工商。此四民，国之良。</p>\n<p style=\"text-align: center;\">曰仁义，礼智信。此五常，不容紊。</p>\n<p style=\"text-align: center;\">地所生，有草木。此植物，遍水陆。</p>\n<p style=\"text-align: center;\">有虫鱼，有鸟兽。此动物，能飞走。</p>\n<p style=\"text-align: center;\">稻粱菽，麦黍稷。此六谷，人所食。</p>\n<p style=\"text-align: center;\">马牛羊，鸡犬豕。此六畜，人所饲。</p>\n<p style=\"text-align: center;\">曰喜怒，曰哀惧。爱恶欲，七情具。</p>\n<p style=\"text-align: center;\">青赤黄，及黑白。此五色，目所识。</p>\n<p style=\"text-align: center;\">酸苦甘，及辛咸。此五味，口所含。</p>\n<p style=\"text-align: center;\">膻焦香，及腥朽。此五臭，鼻所嗅。</p>\n<p style=\"text-align: center;\">匏土革，木石金。丝与竹，乃八音。</p>\n<p style=\"text-align: center;\">曰平上，曰去入。此四声，宜调协。</p>\n<p style=\"text-align: center;\">高曾祖，父而身。身而子，子而孙。</p>\n<p style=\"text-align: center;\">自子孙，至玄曾。乃九族，人之伦。</p>\n<p style=\"text-align: center;\">父子恩，夫妇从。兄则友，弟则恭。</p>\n<p style=\"text-align: center;\">长幼序，友与朋。君则敬，臣则忠。</p>\n<p style=\"text-align: center;\">此十义，人所同。当师叙，勿违背。</p>\n<p style=\"text-align: center;\">斩齐衰，大小功。至缌麻，五服终。</p>\n<p style=\"text-align: center;\">礼乐射，御书数。古六艺，今不具。</p>\n<p style=\"text-align: center;\">惟书学，人共遵。既识字，讲说文。</p>\n<p style=\"text-align: center;\">有古文，大小篆。隶草继，不可乱。</p>\n<p style=\"text-align: center;\">若广学，惧其繁。但略说，能知原。</p>\n<p style=\"text-align: center;\">凡训蒙，须讲究。详训诂，明句读。</p>\n<p style=\"text-align: center;\">为学者，必有初。小学终，至四书。</p>\n<p style=\"text-align: center;\">论语者，二十篇。群弟子，记善言。</p>\n<p style=\"text-align: center;\">孟子者，七篇止。讲道德，说仁义。</p>\n<p style=\"text-align: center;\">作中庸，乃孔伋。中不偏，庸不易。</p>\n<p style=\"text-align: center;\">作大学，乃曾子。自修齐，至平治。</p>\n<p style=\"text-align: center;\">四书熟，孝经通。如六经，始可读。</p>\n<p style=\"text-align: center;\">诗书易，礼春秋。号六经，当讲求。</p>\n<p style=\"text-align: center;\">有连山，有归藏。有周易，三易详。</p>\n<p style=\"text-align: center;\">有典谟，有训诰。有誓命，书之奥。</p>\n<p style=\"text-align: center;\">我周公，作周礼。著六官，存治体。</p>\n<p style=\"text-align: center;\">大小戴，注礼记。述圣言，礼乐备。</p>\n<p style=\"text-align: center;\">曰国风，曰雅颂。号四诗，当讽咏。</p>\n<p style=\"text-align: center;\">诗既亡，春秋作。寓褒贬，别善恶。</p>\n<p style=\"text-align: center;\">三传者，有公羊。有左氏，有谷梁。</p>\n<p style=\"text-align: center;\">经既明，方读子。撮其要，记其事。</p>\n<p style=\"text-align: center;\">五子者，有荀扬。文中子，及老庄。</p>\n<p style=\"text-align: center;\">经子通，读诸史。考世系，知始终。</p>\n<p style=\"text-align: center;\">自羲农，至黄帝。号三皇，居上世。</p>\n<p style=\"text-align: center;\">唐有虞，号二帝。相揖逊，称盛世。</p>\n<p style=\"text-align: center;\">夏有禹，商有汤。周文武，称三王。</p>\n<p style=\"text-align: center;\">夏传子，家天下。四百载，迁夏社。</p>\n<p style=\"text-align: center;\">汤伐夏，国号商。六百载，至纣亡。</p>\n<p style=\"text-align: center;\">周武王，始诛纣。八百载，最长久。</p>\n<p style=\"text-align: center;\">周辙东，王纲坠。逞干戈，尚游说。</p>\n<p style=\"text-align: center;\">始春秋，终战国。五霸强，七雄出。</p>\n<p style=\"text-align: center;\">嬴秦氏，始兼并。传二世，楚汉争。</p>\n<p style=\"text-align: center;\">高祖兴，汉业建。至孝平，王莽篡。</p>\n<p style=\"text-align: center;\">光武兴，为东汉。四百年，终于献。</p>\n<p style=\"text-align: center;\">魏蜀吴，争汉鼎。号三国，迄两晋。</p>\n<p style=\"text-align: center;\">宋齐继，梁陈承。为南朝，都金陵。</p>\n<p style=\"text-align: center;\">北元魏，分东西。宇文周，与高齐。</p>\n<p style=\"text-align: center;\">迨至隋，一土宇。不再传，失统绪。</p>\n<p style=\"text-align: center;\">唐高祖，起义师。除隋乱，创国基。</p>\n<p style=\"text-align: center;\">二十传，三百载。梁灭之，国乃改。</p>\n<p style=\"text-align: center;\">梁唐晋，及汉周。称五代，皆有由。</p>\n<p style=\"text-align: center;\">炎宋兴，受周禅。十八传，南北混。</p>\n<p style=\"text-align: center;\">辽与金，皆称帝。元灭金，绝宋世。</p>\n<p style=\"text-align: center;\">舆图广，超前代。九十年，国祚废。</p>\n<p style=\"text-align: center;\">太祖兴，国大明。号洪武，都金陵。</p>\n<p style=\"text-align: center;\">迨成祖，迁燕京。十六世，至崇祯。</p>\n<p style=\"text-align: center;\">权阉肆，寇如林。李闯出，神器焚。</p>\n<p style=\"text-align: center;\">清世祖，膺景命。靖四方，克大定。</p>\n<p style=\"text-align: center;\">由康雍，历乾嘉。民安富，治绩夸。</p>\n<p style=\"text-align: center;\">道咸间，变乱起。始英法，扰都鄙。</p>\n<p style=\"text-align: center;\">同光后，宣统弱。传九帝，满清殁。</p>\n<p style=\"text-align: center;\">革命兴，废帝制。立宪法，建民国。</p>\n<p style=\"text-align: center;\">古今史，全在兹。载治乱，知兴衰。</p>\n<p style=\"text-align: center;\">史虽繁，读有次。史记一，汉书二。</p>\n<p style=\"text-align: center;\">后汉三，国志四。兼证经，参通鉴。</p>\n<p style=\"text-align: center;\">读史者，考实录。通古今，若亲目。</p>\n<p style=\"text-align: center;\">口而诵，心而惟。朝于斯，夕于斯。</p>\n<p style=\"text-align: center;\">昔仲尼，师项橐。古圣贤，尚勤学。</p>\n<p style=\"text-align: center;\">赵中令，读鲁论。彼既仕，学且勤。</p>\n<p style=\"text-align: center;\">披蒲编，削竹简。彼无书，且知勉。</p>\n<p style=\"text-align: center;\">头悬梁，锥刺股。彼不教，自勤苦。</p>\n<p style=\"text-align: center;\">如囊萤，如映雪。家虽贫，学不辍。</p>\n<p style=\"text-align: center;\">如负薪，如挂角。身虽劳，犹苦卓。</p>\n<p style=\"text-align: center;\">苏老泉，二十七。始发奋，读书籍。</p>\n<p style=\"text-align: center;\">彼既老，犹悔迟。尔小生，宜早思。</p>\n<p style=\"text-align: center;\">若梁灏，八十二。对大廷，魁多士。</p>\n<p style=\"text-align: center;\">彼既成，众称异。尔小生，宜立志。</p>\n<p style=\"text-align: center;\">莹八岁，能咏诗。泌七岁，能赋棋。</p>\n<p style=\"text-align: center;\">彼颖悟，人称奇。尔幼学，当效之。</p>\n<p style=\"text-align: center;\">蔡文姬，能辩琴。谢道韫，能咏吟。</p>\n<p style=\"text-align: center;\">彼女子，且聪敏。尔男子，当自警。</p>\n<p style=\"text-align: center;\">唐刘晏，方七岁。举神童，作正字。</p>\n<p style=\"text-align: center;\">彼虽幼，身已仕。有为者，亦若是。</p>\n<p style=\"text-align: center;\">犬守夜，鸡司晨。苟不学，曷为人。</p>\n<p style=\"text-align: center;\">蚕吐丝，蜂酿蜜。人不学，不如物。</p>\n<p style=\"text-align: center;\">幼而学，壮而行。上致君，下泽民。</p>\n<p style=\"text-align: center;\">扬名声，显父母。光于前，裕于后。</p>\n<p style=\"text-align: center;\">人遗子，金满赢。我教子，唯一经。</p>\n<p style=\"text-align: center;\">勤有功，戏无益。戒之哉，宜勉力。</p>', 1, '古籍', '2020-08-10 00:00:00', 369, 0, 1, 1597049537, 5, 1597051400, 5);
